WE("common/buffer.effekt",'module buffer\n\nimport array\n\n// TODO (in Effekt compiler)\n// - [ ] fix exceptions on objects\n// - [X] allow omitting braces after `at` for singleton regions\n\nrecord BufferOverflow()\n\n/// Fixed-size ring buffers (queues) where one can write\n/// elements to the head and read from the tail.\ninterface Buffer[T] {\n  /// The remaining capacity\n  def capacity(): Int\n\n  /// Is this buffer full?\n  def full?(): Bool\n\n  /// Is this buffer empty?\n  def empty?(): Bool\n\n  /// Read an element from the tail of the buffer\n  def read(): Option[T]\n\n  /// Write an element to the head of the buffer\n  def write(el: T): Unit / Exception[BufferOverflow]\n}\n\ndef emptyBuffer[T](capacity: Int): Buffer[T] at {global} \x3d {\n  if (capacity \x3d\x3d 1) refBuffer()\n  else arrayBuffer(capacity)\n}\ndef arrayBuffer[T](initialCapacity: Int): Buffer[T] at {global} \x3d {\n  // TODO allocate buffer (and array) into a region r.\n  val contents \x3d array::allocate[T](initialCapacity)\n  val head \x3d ref(0)\n  val tail \x3d ref(0)\n\n  def size(): Int \x3d\n    if (tail.get \x3e\x3d head.get) { tail.get - head.get }\n    else { initialCapacity - head.get + tail.get }\n\n  def capacity(): Int \x3d initialCapacity - size()\n\n  def buffer \x3d new Buffer[T] {\n    def capacity() \x3d capacity()\n    def full?() \x3d capacity() \x3c\x3d 0\n    def empty?() \x3d size() \x3c\x3d 0\n    def read() \x3d {\n      if (buffer.empty?) None()\n      else {\n        val result: T \x3d contents.unsafeGet(head.get)\n        head.set(mod(head.get + 1, initialCapacity))\n        Some(result)\n      }\n    }\n    def write(el: T) \x3d {\n      if (buffer.full?) \x3c\x3e // raise(BufferOverflow())\n\n      contents.unsafeSet(tail.get, el)\n      tail.set(mod(tail.get + 1, initialCapacity))\n    }\n  }\n  buffer\n}\ndef refBuffer[T](): Buffer[T] at {global} \x3d {\n  val content \x3d ref(None())\n  new Buffer[T] {\n    def capacity() \x3d if (content.get.isEmpty) 1 else 0\n    def full?() \x3d content.get.isDefined\n    def empty?() \x3d isEmpty(content.get)\n    def read() \x3d {\n      val res \x3d content.get\n      content.set(None())\n      res\n    }\n    def write(el: T) \x3d content.get match {\n      case Some(v) \x3d\x3e\n        \x3c\x3e // do raise(BufferOverflow(), "Cannot read element from buffer")\n      case None() \x3d\x3e\n        content.set(Some(el))\n    }\n  }\n}\n\nnamespace examples {\n  def main() \x3d ignore[BufferOverflow] {\n    // Buffer with capacity 1\n    def b \x3d emptyBuffer[Int](1)\n    println(b.capacity)\n    println(b.full?)\n\n    b.write(17)\n    println(b.read())\n\n    // buffer with capacity 3\n    def ringbuffer \x3d emptyBuffer[Int](3)\n    ringbuffer.write(1)\n    ringbuffer.write(2)\n    println(ringbuffer.read())\n    ringbuffer.write(3)\n    println(ringbuffer.read())\n    println(ringbuffer.read())\n    ringbuffer.write(4)\n    ringbuffer.write(5)\n    println(ringbuffer.read())\n    println(ringbuffer.read())\n  }\n}\n');
WE("common/random.effekt",'module random\n\nimport stream\nimport io/error\n\n/// Infinite pull stream of random bytes.\neffect random(): Byte\n\n// ---------------------\n// Sources of randomness\n\n/// A streaming source (push stream) of byte-level randomness\n/// based on Park and Miller\'s MINSTD with revised parameters.\n///\n/// Deterministic: needs a 32bit `seed` -- you can use `bench::timestamp`.\ndef minstd(seed: Int): Unit / emit[Byte] \x3d {\n  // Initialize state with seed, ensuring it\'s not zero\n  var state \x3d if (seed \x3d\x3d 0) 1 else seed\n\n  def nextInt(): Int \x3d {\n    // Uses only at most 32-bit integers internally\n    // (Schrage\'s method: https://en.wikipedia.org/wiki/Lehmer_random_number_generator#Schrage\'s_method)\n    val a \x3d 48271\n    val m \x3d 2147483647\n\n    val q \x3d m / a           // 44488\n    val r \x3d m.mod(a)        //  3399\n\n    val div \x3d state / q     // max: M / Q \x3d A \x3d 48271\n    val rem \x3d state.mod(q)\t// max: Q - 1     \x3d 44487\n\n    val s \x3d rem * a;        // max: 44487 * 48271 \x3d 2147431977\n    val t \x3d div * r;        // max: 48271 *  3399 \x3d  164073129\n\n    val result \x3d s - t\n    // keep the state positive\n    if (result \x3c 0) result + m else result\n  }\n\n  while (true) {\n    state \x3d nextInt()\n    val b \x3d state.mod(256).toByte\n    do emit(b)\n  }\n}\n\n/// A thin wrapper over `minstd`, handling a reader of random bytes.\n///\n/// Deterministic: needs a 32bit `seed` -- you can use `bench::timestamp`.\n///\n/// Implementation is similar to `stream::source`, specialized for bytes and the `random` effect.\ndef minstd(seed: Int) { randomnessReader: () \x3d\x3e Unit / random }: Unit \x3d {\n  var next \x3d box { 255.toByte } // sentinel value\n  next \x3d box {\n    try {\n      minstd(seed)\n      \x3c\x3e // safe: randomness generator cannot run out of numbers...\n    } with emit[Byte] { v \x3d\x3e\n      next \x3d box { resume(()) }\n      v\n    }\n  }\n\n  try randomnessReader() with random {\n    resume(next())\n  }\n}\n\n/// CSPRNG from `/dev/urandom`, handling a reader of random bytes.\n/// Only works on Unix-like OSes!\ndef devurandom { randomnessReader: () \x3d\x3e Unit / random }: Unit / Exception[IOError] \x3d\n  try {\n    with readFile("/dev/urandom")\n    try randomnessReader() with random {\n      resume(do read[Byte]())\n    }\n  } with stop {\n    do raise(io::error::EOF(), "Unexpected EOF when reading /dev/urandom!")\n  }\n\n// ------------------------\n// Functions using `random`\n//\n// Always two variants:\n// - readType(): Type / random\n// - readTypes(): Unit / {emit[Type], random}\n\ndef randomByte(): Byte / random \x3d do random()\ndef randomBytes(): Unit / {emit[Byte], random} \x3d\n  while (true) do emit(do random())\n\ndef randomBool(): Bool / random \x3d {\n  val b \x3d do random()\n  b.toInt.mod(2) \x3d\x3d 1\n}\ndef randomBools(): Unit / {emit[Bool], random} \x3d\n  while (true) do emit(randomBool())\n\ndef randomInt32(): Int / random \x3d {\n  var result \x3d 0\n  repeat(4) {\n    val b \x3d do random()\n    result \x3d result * 256 + b.toInt\n  }\n  val signBit \x3d result.bitwiseShr(31).bitwiseAnd(1) \x3d\x3d 0\n  result.mod(1.bitwiseShl(31)).abs * if (signBit) 1 else -1\n}\ndef randomInt32s(): Unit / {emit[Int], random} \x3d\n  while (true) do emit(randomInt32())\n\n/// `max` is _inclusive_!\ndef randomInt(min: Int, max: Int): Int / random \x3d {\n  if (min \x3e max) {\n    randomInt(max, min)\n  } else {\n    val range \x3d max - min + 1\n    val bytesNeeded \x3d (log(range.toDouble) / log(256.0)).ceil\n\n    var result \x3d 0\n    repeat(bytesNeeded) {\n      val b \x3d do random()\n      result \x3d result * 256 + b.toInt\n    }\n\n    min + (abs(result).mod(range))\n  }\n}\n/// `max` is _inclusive_!\ndef randomInts(min: Int, max: Int): Unit / {emit[Int], random} \x3d\n  while (true) do emit(randomInt(min, max))\n\n\n/// Random double between 0.0 and 1.0\ndef randomDouble(): Double / random \x3d\n  (randomInt32().toDouble / 1.bitwiseShl(31).toDouble).abs\n  // This is not perfect, but it will do for now.\ndef randomDoubles(): Unit / {emit[Double], random} \x3d\n  while (true) do emit(randomDouble())\n\n\nnamespace examples {\ndef main() \x3d {\n    println("prng")\n    prngRandom()\n  }\n\n  def prngRandom(): Unit \x3d {\n    with minstd(1337);\n\n    println("int32s:")\n    repeat(10) {\n      println(randomInt32())\n    }\n\n    println("int32s, part2:")\n    repeat(10) {\n      println(randomInt(0, 2147483647))\n      println(randomInt(-2147483648, 0))\n    }\n\n    println("doubles:")\n    repeat(10) {\n      println(randomDouble().round(3))\n    }\n\n    println("randomInt:")\n    repeat(10) {\n      val a \x3d randomInt(0, 9)\n      val b \x3d randomInt(0, 9)\n      val c \x3d randomInt(0, 9)\n      println(a.show ++ " " ++ b.show ++ " " ++ c.show)\n      println(a*100 + b*10 + c)\n    }\n  }\n\n  def unixRandom(): Unit \x3d {\n    with on[IOError].report;\n    with devurandom;\n\n    val a \x3d randomInt32()\n    val b \x3d randomInt32()\n\n    // This is just to use the generated numbers :)\n    println((a.show ++ b.show).length !\x3d 0)\n  }\n}');
