WE("common/io/console.effekt",'module io/console\n\nimport io\n\ninterface Console {\n  def readLine(): String\n  def writeLine(content: String): Unit\n}\n\n/// Handler for the console effect, using the Console available in js\ndef console[R] { program: () \x3d\x3e R / Console }: R \x3d {\n  val c \x3d js::newConsole()\n  try {\n    val r \x3d program()\n    js::close(c)\n    return r\n  } with Console {\n    def readLine() \x3d resume(js::readLine(c))\n    def writeLine(message) \x3d resume(js::writeLine(c, message))\n  }\n}\n\nnamespace js {\n\n  extern jsNode !!!MULTILINEMARKER!!!\n    const readline \x3d require(\'node:readline\');\n  !!!MULTILINEMARKER!!!\n\n  extern type JSConsole\n\n  extern io def newConsole(): JSConsole \x3d\n    jsNode !!!MULTILINEMARKER!!!readline.createInterface({\n        input: process.stdin,\n        output: process.stdout,\n      })!!!MULTILINEMARKER!!!\n\n  extern io def close(console: JSConsole): Unit \x3d\n    jsNode "${console}.close()"\n\n  extern async def readLine(console: JSConsole): String \x3d\n    jsNode "$effekt.capture(k \x3d\x3e ${console}.once(\'line\', k))"\n  extern io def writeLine(console: JSConsole, message: String): Unit \x3d\n    jsNode "${console}.output.write(${message} + \'\\\\n\')"\n}\n\nnamespace examples {\n\n  def greeter() \x3d {\n    do writeLine("What\'s your name?")\n    val name \x3d do readLine();\n    do writeLine("Hi " ++ name ++ ", nice to meet you!")\n  }\n\n  def main() \x3d {\n    with console;\n    greeter()\n  }\n\n}\n');
